import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { fontFamily } from '@material-ui/system';

const useStyles = makeStyles(theme => ({
  root: {
    background: "#111111",
    paddingTop: theme.spacing(5),
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: 'black',
    background: 'white',
    minHeight: theme.spacing(15),
    marginLeft: theme.spacing(2),
  },
  paperContent:{
    display: "block",
    marginTop: theme.spacing(2),
    fontFamily: "null for now"
  },
  bottomBar:{
    display: "flex",
    flexDirection: "row"
  },

  leftSide:{

  },

  rightSide:{

  },

}));

export default function Footer() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <Paper className={classes.paper}>Logo here</Paper>
        </Grid>

        <Grid item xs={3}>
          <Paper className={classes.paper}>
            <span className={classes.paperContent}>Profile</span>
            <span className={classes.paperContent}>Signin</span>
            <span className={classes.paperContent}>Music</span>
            </Paper>
        </Grid>

      </Grid>

      <div className={classes.bottomBar}>
        <div className={classes.leftSide}>

        </div>

        <div className={classes.rightSide}>

        </div>

      </div>
    </div>
  );
}
